import { useState } from "react"; 
import axios from "axios"; 
// import { Link } from "react-router-dom"; 

const Form = () => { //formulario y estado deben de tener los mismos valores

    const [form,setForm] = useState({
        name:"",
        min_height: "",
        max_height: "",
        min_weight:"",
        max_weight: "",
        life_span:"",
        temperament:"", 
        image:"",

    }) 

    const [errors, setErrors] = useState({
        name:"",
        min_height: "",
        max_height: "",
        min_weight:"",
        max_weight: "",
        weight:"",
        life_span: "",
        temperament: "", 
        image:"",


    })
    const changeHandler = (e) =>{ //e, me dice quien disparo el event 
         const property = e.target.name; 
         const value = e.target.value; 

         validate({...form, [property]:value}) //el mismo estado tiene validate y va a la par
         setForm({...form, [property]:value}) //cambio el estado y cambia el input


    }
    const validate = (form) =>{

    if( /^[A-Za-z]+/.test(form.name)){
        setErrors({...errors, name:""})

       }else{
        setErrors({...errors, name:"Name error"})
       }
       if(form.name==="") setErrors({...errors, name: "this field can not be blank"})

       if (form.min_height && form.max_height && Number(form.min_height) > Number(form.max_height)) {
        setErrors({ ...errors, max_height: "Max height cannot be smaller than min height" });
      } else {
        setErrors({ ...errors, max_height: "" });
      }
      if (form.min_weight && form.max_weight && Number(form.min_weight) > Number(form.max_weight)) {
        setErrors({ ...errors, max_height: "Max weight cannot be smaller than min height" });
      } else {
        setErrors({ ...errors, max_height: "" });
      }

      }




    const submitHandler= (e)=>{
        const height = `${form.min_height}-${form.max_height}`;//creo las variables y las concateno separandolas con un guion 
        const weight = `${form.min_weight}-${form.max_weight}`;
        e.preventDefault() ///ya no se va la pag ref
         axios.post("http://localhost:3001/dogs", {...form, height,weight})//envio el body form  junto con las variables (weight y hei)
        .then(res=>alert(res))
        .catch(err=>alert(err))


    }



    return (

    <form onSubmit={submitHandler}>
      <div>
        <label>Name:</label>
        <input type= "text " value={form.name} onChange={changeHandler} name= "name"/>
       {errors.name && <span>{errors.name}</span>}  
      </div>

      <div>
        <label>Min Height:</label>
        <input
          type="text"
          value={form.min_height}
          onChange={changeHandler}
          name="min_height"
        />

      </div>

      <div>
        <label>Max Height:</label>
        <input
          type="text"
          value={form.max_height}
          onChange={changeHandler}
          name="max_height"
        />
        {errors.max_height && <span>{errors.max_height}</span>}
        </div>
        <div>

      </div>
      <div>
        <label>Min Weight:</label>
        <input
          type="text"
          value={form.min_weight}
          onChange={changeHandler}
          name="min_weight"
        />
      </div>
      <div>
        <label>Max Weight:</label>
        <input
          type="text"
          value={form.max_weight}
          onChange={changeHandler}
          name="max_weight"
        />
      </div>
      <div>
        <label>Life Span:</label>
        <input type= "text " value={form.life_span}  onChange={changeHandler} name= "life_span"/>
      </div>
      <div>
        <label>Chose a Temperament:</label>
        <input type= "text " value={form.temperament} onChange={changeHandler} name= "temperament"/>
      </div>
      <div>
        <label>image:</label>
        <input type= "text " value={form.image} onChange={changeHandler} name= "image"/>
      </div>
      <button type="submit">Lets Create</button>
    </form>







  );
};

export default Form;
